import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import Home from "./components/pages/Home";
import Beans from "./components/pages/Beans";
import Combinations from "./components/pages/Combinations";
import Facts from "./components/pages/Facts";
import NotFound from "./components/pages/NotFound";
import Recepies from "./components/pages/Recepies";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<div>Home</div>}></Route>
        <Route path="beans" element={<div>Beans</div>}></Route>
        <Route path="facts" element={<div>Facts</div>}></Route>
        <Route path="recipies" element={<div>Recipies</div>}></Route>
        <Route path="combinations" element={<div>Combinations</div>}></Route>
        <Route path="history" element={<div>History</div>}></Route>
        <Route path="*" element={<div>Ops...No such a page</div>}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
